import React from 'react';
import { Link } from "react-router-dom";
import './Nav.css';

const Nav = () => {
  return (
    <div className="nav">
      <div className="tab-row">
        <div className="tab" id="tab1">me</div>
        <div className="tab" id="tab2">projects</div>
        <div className="tab" id="tab3">music</div>
        <div className="tab" id="tab4">art</div>
      </div>
      <nav className="nav">
        <ul className="tab-row">
            <li className="tab" id="tab1">
                <Link to="/home" className="tab" id="tab1">Home</Link>
            </li>
        </ul>
      </nav>
    </div>

  )
}

export default Nav;
